O plano Amostral segundo os itens exigidos por lei seguem descritos: 
Universo: Eleitorado do Estado do Paraná, com 16 anos ou mais. 
Amostragem: A pesquisa irá entrevistar 1500 eleitores aptos. 
Coeficiente de confiança e margem de erro:  A margem de erro de aproximadamente 3% para um intervalo e confiança de 95%.
As ponderações em relação a sexo, idade, grau de instrução e nível econômico, estão descritas no questionário refletindo estatisticamente a proporção do eleitorado consultado. 
Sexo: Feminino 52,4% Masculino 47,6%;   
Faixa Etária: De 16 a 24 anos 12,8%; De 25 a 34 anos 20,4%; De 35 a 44 anos 19,9%; De 45 a 59 anos 26,3%; Mais de 60 anos 20,6%;
Grau de Instrução: Até Fundamental Completo 39,2%; Ensino Médio incompleto ou Completo 39,5%; Ensino Superior Incompleto ou Completo 21,3%;
Nível econômico: Economicamente ativo: Masculino 73,5% e Feminino 53,4%; Não economicamente ativo: Masculino 26,5% e Feminino 46,6%.
Fonte:  TSE 2022, PNADc 2020 e CENSO 2010.

A amostra desta pesquisa será de 1.350 entrevistas, distribuídas da seguinte forma: 
Sexo - masculino: 47%, feminino: 53%;
Idade - 16 a 24 anos: 12%, 25 a 34 anos: 20%, 35 a 44 anos: 20%, 45 a 59 anos: 27%, mais de 59 anos: 21% ; 
Grau de Instrução ¿ De analfabeto até ensino fundamental completo: 38%, Ensino médio completo e incompleto: 41%, Ensino Superior completo e incompleto: 21%; 
Nível Econômico -  Sem rendimento até 2 salários mínimos: 36%, de 2 a 5 salários mínimos: 39%, mais de 5 salários mínimos: 25%. 
Está prevista ponderação das variáveis sexo, faixa etária, grau de instrução e nível econômico, caso ocorram diferenças superior a margem de erro de 2.7 % entre os resultados obtidos em campo e os percentuais previstos para a amostra. O intervalo de confiança é de 95%, e a margem de erro é de 2,7 pontos percentuais para mais ou para menos. Fontes: Sexo, Idade, Grau de Instrução (TSE/Janeiro 2022) e nível econômico (IBGE - https://cidades.ibge.gov.br/brasil/pr/pesquisa/23/24304).

"A amostra será representativa do eleitorado da área pesquisada e será selecionada em três etapas. Na primeira etapa realiza-se um sorteio probabilístico dos municípios onde as entrevistas serão realizadas através do método PPT (Probabilidade Proporcional ao Tamanho), considerando a população eleitora com 16 anos ou mais residente nos municípios como base para essa seleção. Na segunda etapa, faz-se um sorteio probabilístico das localidades, onde as entrevistas serão realizadas, através do método PPT (Probabilidade Proporcional ao Tamanho), tomando a população eleitora de 16 anos ou mais residente nas localidades como base para essa seleção. Na terceira etapa, a seleção do entrevistado dentro da localidade, será feita utilizando-se quotas amostrais proporcionais, em função das seguintes variáveis:
GÊNERO:
Masculino - 47%;
Feminino - 53% |
FAIXA ETÁRIA:
Entre 16 e 24 anos: 14%;
Entre 25 e 34 anos: 20%;
Entre 35 e 44 anos: 19%;
Entre 45 e 59 anos: 26%;
Com 60 anos ou mais: 21% |
ESCOLARIDADE:
De analfabeto até ensino fundamental completo: 37%;
Ensino médio incompleto ou completo: 42%
Ensino superior incompleto ou completo: 21% |
RENDA DOMICILIAR MENSAL:
Sem rendimentos até 2 salários mínimos: 36%
Mais de 2 a 5 salários mínimos: 39%
Mais de 5 salários mínimos: 25%
Está prevista eventual ponderação para correção das variáveis gênero e faixa etária, com base nos percentuais acima apresentados, caso ocorram diferenças superiores a 3,0 (três) pontos percentuais entre o previsto na amostra e a coleta realizada, para as variáveis escolaridade e  renda domiciliar mensal, o fator de ponderação é igual a 1, (resultados obtidos no campo). O nível de confiança estimado é de 95% (noventa e cinco por cento) para uma margem de erro estimada, considerando uma técnica de amostragem aleatória simples, de aproximadamente 2,5 (dois vírgula cinco pontos percentuais para mais ou para menos sobre os resultados obtidos. Fonte de Dados: IBGE Censo 2010 e TSE - Maio 2022."
